import React from 'react';
import './sidebar.css';

const Sidebar = () => {
  return (
    <aside className="sidebar">
      <nav>
        <ul>
          <li><a href="#all"><i class="bi bi-house"></i> All tasks</a></li>
          <li><a href="#important"><i className="bi bi-star"></i> Important tasks</a></li>
          <li><a href="#completed"><i className="bi bi-check-circle"></i> Completed tasks</a></li>
          <li><a href="#incompleted">Incompleted tasks</a></li>
        </ul>
      </nav>
    </aside>
  );
};

export default Sidebar;
